import React from "react";
import { Link } from "react-router-dom";
import "./slender.css";

const Slender = () => {
  return (
    // <div className="slender--container">
    //   <div className="slender--link">
    //     <h1>SLENDER - GAME OVER</h1>

    //     <Link to="/start">Start over</Link>
    //   </div>
    // </div>
    <>
      <div class="content">
        <div class="film">
          <div class="effect">
            <div class="grain">
              <div className="slender--container">
                <div className="slender--link">
                  <h1>SLENDER - GAME OVER</h1>

                  <Link to="/start">Start over</Link>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </>
  );
};

export default Slender;
